import React, { useEffect, useState } from 'react';
import { fetchData } from '../api';

const CategorizedData = ({ endpoint }) => {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const getData = async () => {
      try {
        const result = await fetchData(endpoint);
        setData(result); // Store the fetched data
      } catch (err) {
        setError(err.message);
      }
    };
    getData();
  }, [endpoint]);

  if (error) return <p>Error: {error}</p>;
  if (!data) return <p>Loading...</p>;

  return (
    <div>
      <h2>{endpoint.charAt(0).toUpperCase() + endpoint.slice(1)} Data</h2>
      <DataTable data={data} />
    </div>
  );
};

const DataTable = ({ data }) => {
  if (!Array.isArray(data) || data.length === 0) {
    return <p className="text-center text-gray-500">No data available.</p>;
  }

  // Extract headers dynamically from the first row
  const tableHeaders = Object.keys(data[0]);

  return (
    <div className="overflow-x-auto mt-4">
      <table className="min-w-full bg-white border border-gray-300">
        <thead>
          <tr className="bg-blue-500 text-white">
            {tableHeaders.map((header, index) => (
              <th
                key={index}
                className="py-2 px-4 border-b border-gray-200 text-left capitalize"
              >
                {header.replace(/([A-Z])/g, " $1").trim()}
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {data.map((row, rowIndex) => (
            <tr
              key={rowIndex}
              className={`${
                rowIndex % 2 === 0 ? "bg-gray-50" : "bg-white"
              } hover:bg-gray-100`}
            >
              {tableHeaders.map((header, colIndex) => (
                <td
                  key={colIndex}
                  className="py-2 px-4 border-b border-gray-200"
                >
                  {row[header] !== null && row[header] !== undefined && row[header] !== ""
                    ? row[header]
                    : "N/A"}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};






export default CategorizedData;
